INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24001, "2019/01/31 12:00:00", -385.0, 2, "エリコ（バレンタイン）", 0, 4.08, 109001, "2030/12/17 14:59:59", 10011, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 24, 1, 8.0, 1);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24002, "2019/01/31 12:00:00", -385.0, 2, "エリコ（バレンタイン）", 0, 5.0, 109001, "2030/12/17 14:59:59", 10011, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 24, 2, 8.0, 1);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24003, "2019/01/31 12:00:00", -385.0, 2, "エリコ（バレンタイン）", 0, 10.11, 109001, "2030/12/17 14:59:59", 10011, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 24, 3, 8.0, 1);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24004, "2019/01/31 12:00:00", -385.0, 2, "エリコ（バレンタイン）", 0, 4.0, 109001, "2030/12/17 14:59:59", 10011, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 24, 4, 8.0, 1);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24005, "2019/01/31 12:00:00", -385.0, 2, "エリコ（バレンタイン）", 0, 6.0, 109001, "2030/12/17 14:59:59", 10011, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 24, 5, 8.0, 1);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24006, "2019/01/31 12:00:00", 0.0, 1, "エリコ（バレンタイン）", 0, 0.0, 109002, "2030/12/17 14:59:59", 10011, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 24, 6, 0.0, 1);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24007, "2019/01/31 12:00:00", 0.0, 1, "エリコ（バレンタイン）", 0, 0.0, 109002, "2030/12/17 14:59:59", 10011, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 24, 7, 0.0, 1);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24008, "2019/01/31 12:00:00", 0.0, 1, "エリコ（バレンタイン）", 0, 0.0, 109002, "2030/12/17 14:59:59", 10011, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 24, 8, 0.0, 1);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24009, "2019/01/31 12:00:00", 0.0, 1, "エリコ（バレンタイン）", 0, 0.0, 109002, "2030/12/17 14:59:59", 10011, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 24, 9, 0.0, 1);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24010, "2019/01/31 12:00:00", 0.0, 1, "エリコ（バレンタイン）", 0, 0.0, 109002, "2030/12/17 14:59:59", 10011, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 24, 10, 0.0, 1);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24011, "2019/01/31 12:00:00", -385.0, 2, "シズル（バレンタイン）", 0, 2.12, 109101, "2030/12/17 14:59:59", 10011, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 24, 1, 8.0, 1);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (24012, "2019/01/31 12:00:00", -385.0, 2, "シズル（バレンタイン）", 0, 4.19, 109101, "2030/12/17 14:59:59", 10011, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 24, 2, 8.0, 5);
